import Pizzas from './Components/Pizzas';
import Order from './Components/Order'
import ImageSlider from './Components/ImageSlider';
import Footer from './Components/Footer';
function App() {
  return (
    <div className="App">
<Navbar/>
<Cards/>
<Pizzas/>
<Order/>
